import React from "react";
import './UserListModal.scss';


const UserListModal = (props) => {
    return (
        <div className="userListModal">
            <div className="userModalOverlay"></div>
            <div class="closeBtn"><svg aria-label="닫기" class="_8-yf5 " color="#ffffff" fill="#ffffff" height="24" role="img" viewBox="0 0 24 24" width="24"><polyline fill="none" points="20.643 3.357 12 12 3.353 20.647" stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" stroke-width="3"></polyline><line fill="none" stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" stroke-width="3" x1="20.649" x2="3.354" y1="20.649" y2="3.354"></line></svg></div>
            <div className="userModalContent">
                <div className="userListTitle">사용자 정보</div>
                <div className="userListContent">
                    <table className="userListTable">
                        <thead>
                            <th>ID</th>
                            <th>Name</th>
                            <th>Tell</th>
                            <th>Email</th>
                            <th>Sign-up Date</th>
                        </thead>
                        <tbody>
                            
                        </tbody>
                    </table>
                </div>
            </div>
        </div>
    );
};

export default UserListModal;
